import React, { Component } from 'react';
import './headingeffect.css';
import {Link} from 'react-scroll';

class FrontPageText extends Component {

  render() {
    return (
    	<div >
    		<h1 style={{color:'white',position:'absolute',top:300,left:550}}> ANJALI JAIN</h1>
    		<p className='p1' style={{position:'absolute',top:350,left:580}}>This is text1.</p>
          <p className='p1' style={{position:'absolute',top:350,left:580}}>Hello Text2</p>
        
         <Link
            activeClass="active"
            to="about"
            spy={true}
            smooth={true}
            offset={0}
            duration= {500}
          ><span className='mouse'>
            <span className='mouse-movement'>
            </span>
          </span>
        </Link>
    	</div>
    );
  }
}

export default FrontPageText;
